import logo from './logo.svg';
import './App.css';
import UserInfo from './UserInfo';

const comment = {
  date: new Date(),
  text: 'I hope you enjoy learning React!',
  author: {
    name: 'Hello pidar',
    avatarUrl: 'http://placekitten.com/g/64/64'
  }
};


function App() {
  return (
    <div className="App">
      <UserInfo
        date={comment.date}
        text={comment.text}
        author={comment.author} />,

    </div>
  );
}

export default App;
